import axios from 'axios';

export function meFromToken(tokenFromStorage) {
  axios({
    method: 'get',
    // body: {},
    url: `https://jastegri.pythonanywhere.com/auth/users/me/`,
    headers: {
      Authorization: `Bearer ${tokenFromStorage}`,
    },
  }).then(({ data }) => {
    return {
      type: 'ME_FROM_TOKEN',
      payload: data,
    };
  });

  // return ;
}

